INSERT INTO `lkp_emailactivity` VALUES (1,'New user added successfully',1,'New User',1,'<p>Dear {{Name}},</p>\r <p>Welcome to Clinion CTMS!</p>\r <p>Your account has been created in the CTMS.<br />\r Here are your login details:<br />\r Username - {{Username}}<br />\r Password - {{Password}}<br />\r <a href =\'http://183.82.108.66:6262/ctms/#/login\'>Click Here to login to the system. </p>\r <p>CTMS - Admin</p>'),(2,'study assigned successfully',1,'Study Assigned to an Existing User',1,'<p>Dear {{Name}},</p>\r <p>You have been assigned to the project, {{Studyname}}, as a {{Rolename}}. Please check the Projects List section to access the new project.<br />\r <a href =\'http://183.82.108.66:6262/ctms/#/login\'>Click Here to login to the system. </p>\r <p>CTMS - Admin</p>'),(3,'Access Revoked successfully',1,'Access Revoked',1,'<p>Dear {{Name}}, </p>\n<p>Your access to the project, {{Studyname}} as a {{Rolename}}, has been revoked. Please check the Projects list section to access the project. <br />\nYou will be intimated if your access is activated again.</p>\n<p>CTMS - Admin</p>'),(4,'Access Activated successfully',1,'Access Activated',1,'<p>Dear {{Name}}, </p>\r <p>Your access to the project, {{Studyname}}, as a {{Rolename}}, which was revoked on {{ModifiedDate}}, has been activated again. <br />\r <a href =\'http://183.82.108.66:6262/ctms/#/login\'>Click Here to login to the system. </p>\r <p>CTMS - Admin</p>'),(5,'project Assigned to Project Manager surojectfully',1,'Project Assigned to Project Manager',1,'<p>Dear {{Name}},</p>\r <p>You have been assigned to the project, {{Studyname}}, as a {{Rolename}}. Please check the Projects List section to access the new project.<br />\r <a href =\'http://183.82.108.66:6262/ctms/#/login\'>Click Here to login to the system. </p>\r <p>CTMS - Admin</p>'),(6,'Account Locked',1,'Account Locked',1,'<p>Dear Admin,</p>\r <p>The account of the user, {{Name}} has been locked due to 3 incorrect password attempts. <br />\r Please <a href =\'http://183.82.108.66:6262/ctms/#/login\'> Login to unlock the user.</p>\r <p>CTMS - Support</p>'),(7,'Account Lock Remainder',1,'Account Locked Reminder - to be sent 3 days after first intimation',1,'<p>Dear Admin, </p>\r <p>Please unlcok the account of the user, {{Name}}.<br />\r  <a href=\'http://183.82.108.66:6262/ctms/#/login\'>Click here to login.</p>\r <p>CTMS - Support</p>'),(8,'password reset successfully',1,'Password Reset',1,'<p>Dear {{Name}}, </p>\r <p>Your account has been unlocked. <br />\r Please login with the password given below:<br />\r Password: {{Password}}</p>\r <p><a href=\'http://183.82.108.66:6262/ctms/#/login\'>Click here to login.</p>\r <p>CTMS - Admin</p>'),(9,'CRA assigned for site successfully',1,'CRA assigned to a site',2,'<p>Hello {{Name}},</p>\n<p>You have been assigned as a CRA to the site{{SiteName}}, of Study {{StudyName}}. Your visit schedule for the site and pre-visit report notifications will be shared shortly.</p>\n<p>Kind regards,<br />\nCTMS</p>'),(10,'CRA unassigned for site successfully',1,'CRA unassgined from a site',2,'<p>Hello {{Name}}, </p>\n<p>This is to inform you that you have been unassigned from the site {{SiteName}}. Please contact your Project Manager for further information.</p>\n<p>Kind regards,<br />\nCTMS</p>'),(11,'Milestone created successfully',1,'Milesone Achieved & Invoice Raised',2,'<p>Hello Finance Team,<br />\nThis is to informa you that the milesone {{mileStone}} of the study {{StudyName}} <br />\nhas been achieved. The invoice No. {{InvoiceNo}} of amount {{Rs}}. {{Amount}} has been raised. <br />\nPlease login, verify and share the executed hardcopy with the sponsr.<br />\nKind regards,<br />\nCTMS</p>'),(12,'Visit schedule created successfully',1,'Visit Schedule Notification to CRA',2,'<p>Hello {{Name}}</p>\n<p>Your visit to Site {{StudyName}} for study {{SiteName}} , has been scheduled on DD/MM/YYYY to {{ToDate}}</p>\n<p>Kind regards,<br />\nCTMS</p>'),(13,'Visit rescheduled successfully',1,'Visit Re-Schedule Notification to CRA',2,'<p>Hello {{Name}}</p> <p>Your visit to Site {{SiteName}} for study {{StudyName}}, has been rescheduled on <br /> {{FromDate}} to {{ToDate}} </p> <p>Kind regards,<br /> CTMS</p>'),(14,'Report submitted to PM successfully',1,'Report Submitted by Monitor to PM',2,'<p>Hello {{Name}},</p>\n<p>This is to inform you that the report for visit, condcuted by CRA ({{Name}}), on {{Date}}<br />\nhas been submitted. <br />\nClick here to login and review. </p>\n<p>Kind regards,<br />\nCTMS</p>'),(15,'Report submitted to Sponsor successfully',1,'Report Submitted to Sponsor',2,'<p>Hello {{Name}},</p>\n<p>Greetings!</p>\n<p>This is to inform you that the report for Visit {{VisitName}} of Study {{StudyName}} has been submitted for your review. <br />\nClick here to login.</p>\n<p>Kind regards,<br />\nCTMS</p>'),(16,'Finalized Report Â by Sponsor',1,'Report Finalized by Sponsor',2,'<p>Hello {{Name}}</p>\n<p>This is to inform you that the report xx of visit {{VisitName}}, study {{StudyName}} has been finalized by the Sponsor.</p>\n<p>Kind regards,<br />\nCTMS</p>'),(17,'Invoice Sent - Mail to Sponsor',1,'Invoice Sent - Mail to Sponsor',3,'<p>Hello, Greetings!<br />\nstudy {{StudyName}} This is to inform you that the milestone {{mileStone}} has been achieved. <br />\nThe invoice No. {{InvoiceNo}}of amount {{Rs}}.&quot;{{Amount}} has been raised and <br />\ndispatched to you. The payment due date of this invoice is {{DueDate}}.<br />\nKindly process the invoice soon. </p>\n<p>Best regards <br />\nJSS-Finance Team.</p>'),(18,'Payment Reminder',1,'Payment Reminder',2,'<p>Hello,</p>\n<p>Please consider this as a gentle reminder for the invoice {{InvoiceNo}}. <br />\nThe payment due date is {{DueDate}}.<br />\nPlease clear the payment soon.</p>\n<p>Kind regards,<br />\nJSS-Finance Team</p>');
/*!40000 ALTER TABLE `lkp_emailactivity` ENABLE KEYS */;
UNLOCK TABLES;

