INSERT INTO `trans_notifications` VALUES (1,NULL,'Admin Module',NULL,'CTMS - Login Details','<p>Dear {{Name}},</p>\r <p>Welcome to Clinion CTMS!</p>\r <p>Your account has been created in the Clinion CTMS.<br />\r Here are your login details:<br />\r Username - {{Username}}<br />\r Password - {{Password}}<br />\r <a href = \'{{siteURL}}\'>Click Here to login to the system. </p>\r <p>Clinion Support</p>','New User','',1,NULL,'2018-09-14 11:14:46',NULL,NULL,NULL,NULL,1,'New User','Admin'),(2,NULL,'Admin Module',NULL,'CTMS - New Project Assigned','<p>Dear {{Name}},</p>\r <p>You have been assigned to the project, {{Studyname}}, as a {{Rolename}}. Please check the Projects List section to access the new project.<br />\r <a href = \'{{siteURL}}\'>Click Here to login to the system. </p>\r <p>CTMS Support</p>','User','3',1,NULL,'2018-09-14 11:14:47',NULL,NULL,NULL,NULL,2,'Study Assigned to an Existing User','Admin'),(3,NULL,'Admin Module',NULL,'Access Revoked - {{Studyname}}','<p>Dear {{Name}},</p> <p>Your access to the project, {{Studyname}} as a {{Rolename}}, has been revoked. Please check the Projects list section to access the project. <br /> You will be intimated if your access is activated again.<br/></p> <p>CTMS - Ad...','User','2,3',1,NULL,'2018-09-14 11:14:47',NULL,NULL,NULL,NULL,3,'Access Revoked','Admin'),(4,NULL,'Admin Module',NULL,'Access Activated - {{Studyname}}','<p>Dear {{Name}}, </p>\r <p>Your access to the project, {{Studyname}}, as a {{Rolename}}, which was revoked on {{ModifiedDate}}, has been activated again. <br />\r <a href = \'{{siteURL}}\'>Click Here to login to the system. </p>\r <p>CTMS - Admin</p>','User','2,3',1,NULL,'2018-09-14 11:14:47',NULL,NULL,NULL,NULL,4,'Access Activated','Admin'),(5,NULL,'Admin Module',NULL,'CTMS - New Project Assigned','<p>Dear {{Name}},</p> <p>You have been assigned to the project, {{Studyname}}, as a Project Manager. Please check the Projects List to access the project.</p> <p>CTMS - Admin</p>','User','',1,NULL,'2018-09-14 11:14:47',NULL,NULL,NULL,NULL,5,'Project Assigned to Project Manager','Admin'),(6,NULL,'Admin Module',NULL,'CTMS  - User Account Locked','<p>Dear Admin,</p>  <p>The account of the user, {{Name}} has been locked due to 3 incorrect password attempts. <br/>  Please <a href=\'http://183.82.108.66:6262/ctms/#/login\'>Login</a> to unlock the user.</p>  <p>CTMS - Admin</p>','Admin','3',1,NULL,'2018-09-14 11:14:47',NULL,NULL,NULL,NULL,6,'Account Locked','System'),(7,NULL,'Admin Module',NULL,'CTMS - Unlock Account - Reminder','<p>Dear Admin,</p>  <p>Please unlcok the account of the user, {{Name}}. <br/>  <a href=\'http://183.82.108.66:6262/ctms/#/login\'>Click here</a> to login.</p>  <p>CTMS - Admin</p>','Admin','3',1,NULL,'2018-09-14 11:14:47',NULL,NULL,NULL,NULL,7,'Account Locked Reminder - to be sent 3 days after first intimation','System'),(8,NULL,'Admin Module',NULL,'CTMS - Account unclocked','<p>Dear {{Name}},</p>  <p>Your account has been unlocked.  Please login with the password given below:. <br/>  Password: {{Password}} <br/>  <a href=\'http://183.82.108.66:6262/ctms/#/login\'>Click here</a> to login.</p>  <p>CTMS - Admin</p>','User','3',1,NULL,'2018-09-14 11:14:47',NULL,NULL,NULL,NULL,8,'Password Reset','Admin'),(9,NULL,'Project Management Module',NULL,'Study {{StudyName}}: CRA Assigned to Site {{SiteName}}','Study {{StudyName}}: CRA Assigned to Site {{SiteName}} <p>Hello {{Name}},</p>  <p>You have been assigned as a CRA to the site {{SiteName}}, of Study {{StudyName}}. Your visit schedule <br />  for the site and pre-visit report notifications will be shared...','Monitor/CRA','6',1,NULL,'2018-09-14 11:14:47',NULL,NULL,NULL,NULL,9,'CRA assigned to a site','Project Manager'),(10,NULL,'Project Management Module',NULL,'Study {{StudyName}}: CRA Unassigned from Site {{SiteName}}','<p>Hello {{Name}}, </p>  <p>This is to inform you that you have been unassigned from the site {{SiteName}}. Please contact your <br />  Project Manager for further information.</p>  <p>