CREATE DEFINER=`root`@`localhost` PROCEDURE `GetAllStudyXSitesInfoBasedonCompanyId`(in pCompanyId varchar(500))
BEGIN

select ss.* , p.*, s.*
from trans_studyxsites as ss 
inner join trans_projects as p on  ss.StudyId=p.Id
inner join trans_sites as s on s.Id=ss.SiteId
where ss.IsActive=1 and p.CompanyId=pCompanyId;

END ;;
