CREATE DEFINER=`root`@`localhost` PROCEDURE `proc_addFeature`(in pName VARCHAR(100))
begin
DECLARE rolecount INT DEFAULT 0;
DECLARE FeatureId INT DEFAULT 0;
DECLARE pCompanyId VARCHAR(200);
DECLARE _continue INT DEFAULT 0;
DEClARE rolesxfeature_cursor CURSOR  FOR 
select CompanyId From trans_company;
DECLARE continue HANDLER FOR NOT FOUND
    SET _continue =1;

SELECT COUNT(*) FROM lkp_roles INTO rolecount;

#insert record for feature
INSERT INTO lkp_features (`Name`) VALUES (pName);

set FeatureId=(select Id from lkp_features order by Id desc limit 1);

#insert records for add above feature to all rolles 
insert into lkp_rolesxfeatures(RoleId, FeatureId) select lr.Id,FeatureId FROM lkp_roles lr LIMIT rolecount;


#insert records for add above feature to all rolles in trans_ table for all company
OPEN rolesxfeature_cursor;
get_rolesxfeature: LOOP
 FETCH rolesxfeature_cursor INTO pCompanyId;
if _continue!=1 then
 INSERT INTO trans_rolesxfeatures(RoleId, FeatureId,CompanyId) select lr.Id,FeatureId,pCompanyId FROM lkp_roles lr LIMIT rolecount;
 else
 leave get_rolesxfeature;
 end if;
END LOOP get_rolesxfeature;

 CLOSE rolesxfeature_cursor;

select id from lkp_features order by id desc limit 1;
end ;;
DELIMITER ;
/*!50003 SET sql_mode              = @saved_sql_mode */ ;
/*!50003 SET character_set_client  = @saved_cs_client */ ;
/*!50003 SET character_set_results = @saved_cs_results */ ;
/*!50003 SET collation_connection  = @saved_col_connection */ ;
