CREATE DEFINER=`root`@`localhost` PROCEDURE `proc_addFeatureaction`(in pName VARCHAR(100),in pFeatureId int)
begin

DECLARE ActionId INT DEFAULT 0;
DECLARE rolecount INT DEFAULT 0;
DECLARE pCompanyId VARCHAR(200);
DECLARE _continue INT DEFAULT 0;
DEClARE rolesxfeaturesxactions_cursor CURSOR  FOR 
select  CompanyId from trans_company;
DECLARE continue HANDLER FOR NOT FOUND
    SET _continue =1;

SELECT COUNT(*) FROM lkp_roles INTO rolecount;
#inset records for actions related feature
INSERT INTO lkp_actions (`Name`) VALUES (pName);



set ActionId=(select id from lkp_actions order by id desc limit 1);

#inset records for above action in featureactions
INSERT INTO lkp_featureactions(`FeatureId`, `ActionId`) VALUES (pFeatureId,ActionId);


#insert records for add above featureactions to all rolles 
insert into lkp_rolesxfeaturesxactions(RoleId, FeatureActionId) select lr.Id,ActionId FROM lkp_roles lr LIMIT rolecount;


#insert records for add above featureactions to all rolles in trans_ table for all company


OPEN rolesxfeaturesxactions_cursor;
get_rolesxfeaturesxactions: LOOP
 FETCH rolesxfeaturesxactions_cursor INTO pCompanyId;
if _continue!=1 then
 insert into trans_rolesxfeaturesxactions(RoleId,FeatureActionId,CompanyId) select lr.Id,ActionId,pCompanyId FROM lkp_roles lr LIMIT rolecount;
 else
 leave get_rolesxfeaturesxactions;
 end if;
END LOOP get_rolesxfeaturesxactions;

 CLOSE rolesxfeaturesxactions_cursor;

end ;;
DELIMITER ;
