CREATE DEFINER=`root`@`localhost` PROCEDURE `proc_Auditlog`(in PCompanyId VARCHAR(500),
in pStudyId int)
begin
if(pStudyId>0) then
select a.*,u.*,f.* from trans_auditlog a inner join trans_users u 
on u.Id=a.CreatedById 
inner join lkp_features f on f.Id=a.FeatureId
 where a.StudyId=pStudyId ;
else
select a.*,u.*,f.*,com.* from trans_auditlog a inner join trans_users u 
on u.Id=a.CreatedById 
inner join lkp_features f on f.Id=a.FeatureId
left join trans_company com on com.CompanyId=a.CompanyId
 where a.CompanyId=PCompanyId ;
 end If;
 
 end ;;
