CREATE DEFINER=`root`@`localhost` PROCEDURE `proc_BasicInsertion`(
pComapanyName VARCHAR(1000),
 pAddressLine1 VARCHAR(1000), 
 pAddressLine2 VARCHAR(1000), 
 pContryId TINYINT(4),
 pStateId TINYINT(4), 
 pCity VARCHAR(500),
 pLocation VARCHAR(500),
 pZipCode VARCHAR(500), 
 pUsers INT(11), 
 pStudies INT(11), 
 pContactNumber VARCHAR(20), 
 pAlternativeNumber VARCHAR(20), 
 pCompanyEmail VARCHAR(100),
 pAlternativeEmail VARCHAR(100), 
 pCreatedById INT(11), 
 pCreatedIP VARCHAR(45),
 pCreatedDate datetime,
 pPassword VARCHAR(45))
Begin

#Declarations insert company

DECLARE oldcount INT DEFAULT 0;
DECLARE latestcount INT DEFAULT 0;
DECLARE pcompanyId INT DEFAULT 0;

#Declarations insert role

DECLARE n INT DEFAULT 0;
DECLARE i INT DEFAULT 0;

#Declarations insert rolesxfeatures
DECLARE featurecount INT;
declare v_role int;
DECLARE _continue INT DEFAULT 0;

#Declarations insert rolesxfeaturesxactions
DECLARE featurexacioncount INT;
declare K_role int;


DEClARE rolesxfeature_cursor CURSOR  FOR 
SELECT Id from trans_roles where CompanyId=pcompanyId;

DEClARE rolesxfeaturesxaction_cursor CURSOR  FOR 
SELECT Id from trans_roles where CompanyId=pcompanyId;

DECLARE continue HANDLER FOR NOT FOUND
SET _continue =1;

SELECT COUNT(*) FROM lkp_roles INTO n;
if(n>0) then

  #insert role for the particular company
  set oldcount=(select count(*) from trans_company);
 insert into trans_company(ComapanyName, AddressLine1, AddressLine2, ContryId, StateId, City, Location, ZipCode, Users, Studies, ContactNumber, AlternativeNumber, CompanyEmail, AlternativeEmail, CreatedById, CreatedIP, CreatedDate)values
 (pComapanyName, pAddressLine1, pAddressLine2, pContryId, pStateId, pCity, pLocation, pZipCode, pUsers, pStudies, pContactNumber, pAlternativeNumber, pCompanyEmail, pAlternativeEmail, pCreatedById, pCreatedIP, pCreatedDate);
  
  set latestcount=(select count(*) from trans_company);
  if(latestcount=(oldcount+1)) then
     
     set pcompanyId=(SELECT Id FROM trans_company ORDER BY id DESC LIMIT 1);
    #insert user for the particular company
   insert into trans_users(Name, UserName, Password, EmailId, MobileNo, RoleId, CreatedBy, CreatedIP,CompanyId)values
  (pComapanyName,pCompanyEmail,pPassword,pCompanyEmail,pContactNumber,10,1,pCreatedIP,pcompanyId);
  
  
  #insert role for the particular company
  insert into trans_roles(Id, Name, CompanyId, CreatedDate, CreatedBy, CreatedIP)
  select lr.Id, lr.Name,pcompanyId,pCreatedDate,pCreatedBy,pCreatedIP FROM lkp_roles lr LIMIT n;
  
  
  #insert rolesxfeatures for the particular company
SELECT COUNT(*) FROM lkp_features INTO featurecount;

OPEN rolesxfeature_cursor;
get_rolesxfeature: LOOP
 FETCH rolesxfeature_cursor INTO v_role;
if _continue!=1 then
 INSERT INTO trans_rolesxfeatures(RoleId, FeatureId,CompanyId)  select v_role, lf.Id,pcompanyId FROM lkp_features lf LIMIT featurecount;
 else
 leave get_rolesxfeature;
 end if;
END LOOP get_rolesxfeature;

 CLOSE rolesxfeature_cursor;
 
 
end if;
 
 
 
END if;
  end ;;
DELIMITER ;
/*!50003 SET sql_mode              = @saved_sql_mode */ ;
/*!50003 SET character_set_client  = @saved_cs_client */ ;
