CREATE DEFINER=`root`@`localhost` PROCEDURE `proc_CompanyRegistration`(
pComapanyName VARCHAR(1000),
 pAddressLine1 VARCHAR(1000), 
 pAddressLine2 VARCHAR(1000), 
 pContryId TINYINT(4),
 pStateId TINYINT(4), 
 pCity VARCHAR(500),
 pLocation VARCHAR(500),
 pZipCode VARCHAR(500), 
 pUsers INT(11), 
 pStudies INT(11), 
 pContactNumber VARCHAR(20), 
 pAlternativeNumber VARCHAR(20), 
 pCompanyEmail VARCHAR(100),
 pAlternativeEmail VARCHAR(100), 
 pCreatedById INT(11), 
 pCreatedIP VARCHAR(45),
 pCreatedDate datetime,
 pPassword VARCHAR(45),
 pGenerateCompanyId VARCHAR(200))
Begin

#Declarations insert company

DECLARE oldcount INT DEFAULT 0;
DECLARE rolecreatedby INT default 0;
DECLARE latestcount INT DEFAULT 0;
DECLARE pcompanyId varchar(200) DEFAULT null;
DECLARE pautocompanyId INT DEFAULT 0;

#Declarations insert role
DECLARE rolecount INT DEFAULT 0;
DECLARE i INT DEFAULT 0;

#Declarations insert rolesxfeatures
DECLARE featurecount INT;

#Declarations insert rolesxfeaturesxactions
DECLARE featurexacioncount INT;

# to handle the Error through Query
DECLARE errno INT;
    DECLARE EXIT HANDLER FOR SQLEXCEPTION
    BEGIN
    GET CURRENT DIAGNOSTICS CONDITION 1 errno = MYSQL_ERRNO;
    SELECT errno AS MYSQL_ERROR;
    ROLLBACK;
    END;
 START TRANSACTION;
SELECT COUNT(*) FROM lkp_roles INTO rolecount;

SELECT COUNT(*) FROM lkp_rolesxfeatures INTO featurecount;

SELECT COUNT(*) FROM lkp_rolesxfeaturesxactions INTO featurexacioncount;

if(rolecount>0) then

  #insert role for the particular company
  set oldcount=(select count(*) from trans_company);
 insert into trans_company(ComapanyName, AddressLine1, AddressLine2, CountryId, StateId, City, Location, ZipCode, Users, Studies, ContactNumber, AlternativeNumber, CompanyEmail, AlternativeEmail, CreatedById, CreatedIP, CreatedDate)values
 (pComapanyName, pAddressLine1, pAddressLine2, pContryId, pStateId, pCity, pLocation, pZipCode, pUsers, pStudies, pContactNumber, pAlternativeNumber, pCompanyEmail, pAlternativeEmail, pCreatedById, pCreatedIP, pCreatedDate);
  
  set latestcount=(select count(*) from trans_company);
  if(latestcount=(oldcount+1)) then
     
	set pautocompanyId=(SELECT Id FROM trans_company ORDER BY id DESC LIMIT 1);
    
    set pcompanyId=Concat(pGenerateCompanyId,pautocompanyId);
    #update comanyId in particular Company
    
     update trans_company set CompanyId=pcompanyId where Id=pautocompanyId;
     
    #insert user for the particular company
    
   insert into trans_users(Name, UserName, Password, EmailId, MobileNo, RoleId,CreatedBy, CreatedIP,CompanyId)values
  (pComapanyName,pCompanyEmail,pPassword,pCompanyEmail,pContactNumber,10,1,pCreatedIP,pcompanyId);
  
  set rolecreatedby = (SELECT Id FROM trans_users ORDER BY id DESC LIMIT 1);
  #insert role for the particular company
  insert into trans_roles(Id, Name, IsActive, IsDefaultRole, CompanyId, CreatedDate, CreatedIP, CreatedBy)
  select lr.Id, lr.Name, IsActive, IsDefaultRole, pcompanyId,pCreatedDate,pCreatedIP, rolecreatedby FROM lkp_roles lr LIMIT rolecount;
  
  
  #insert rolesxfeatures for the particular company
   

  insert into trans_rolesxfeatures(RoleId,FeatureId, IsActive, CompanyId,CreatedDate,CreatedIP)
  select RoleId,FeatureId,IsActive,pcompanyId,pCreatedDate,pCreatedIP FROM lkp_rolesxfeatures lr LIMIT featurecount;
  
  #insert  rolesxfeaturesxaction for the particular company
  
   insert into trans_rolesxfeaturesxactions(RoleId,FeatureActionId, IsActive, CompanyId,CreatedDate,CreatedIP)
  select RoleId,FeatureActionId, IsActive, pcompanyId,pCreatedDate,pCreatedIP FROM lkp_rolesxfeaturesxactions lr LIMIT featurexacioncount;
  
 
end if;
 
 
 
END if;
	SELECT id FROM trans_company ORDER BY id DESC LIMIT 1;
COMMIT WORK;
end ;;
DELIMITER ;
