CREATE DEFINER=`root`@`localhost` PROCEDURE `Proc_CreateSiteCra`(
In pSiteId int,
In pCraId int,
IN pAssignStatus bool,
IN pAssignedOn datetime,
In pCreatedBy int,
IN pCreatedDate datetime,
In pCreatedIp varchar(20),
In pStudyId int
)
BEGIN

if exists(select * from trans_sitexcras where SiteId=pSiteId and CraId= pCraId and StudyId=pStudyId) then

update trans_sitexcras set 
AssignStatus=pAssignStatus, 
AssignedOn=pAssignedOn,
ModifiedDate = pCreatedDate,
ModifiedById =pCreatedBy,ModifiedIp=pCreatedIp
where SiteId=pSiteId and CraId= pCraId 
and StudyId=pStudyId;

else
 insert into trans_sitexcras(StudyId,SiteId,CraId,AssignStatus,AssignedOn,CreatedById,CreatedDate,CreatedIp) 
values(pStudyId,pSiteId,pCraId,pAssignStatus,pAssignedOn,pCreatedBy,pCreatedDate,pCreatedIp);
 end if;
END ;;
