CREATE DEFINER=`root`@`localhost` PROCEDURE `proc_DrugNearingExpiry`(IN pStudyId int)
begin
if(pStudyId>0) then
select tis.*,tp.*,ts.*,ti.* from trans_inventoryissue tis inner join  trans_projects  tp on tis.StudyId=tp.Id
inner join   trans_sites ts on tis.SiteId=ts.id
inner join  trans_inventorystock ti on tis.StockId=ti.id where ti.IsActive=1 and tp.Id=pStudyId ;
else
select tis.*,tp.*,ts.*,ti.* from trans_inventoryissue tis inner join  trans_projects  tp on tis.StudyId=tp.Id
inner join   trans_sites ts on tis.SiteId=ts.id
inner join  trans_inventorystock ti on tis.StockId=ti.id where ti.IsActive=1;
end if;
end ;;
