CREATE DEFINER=`root`@`localhost` PROCEDURE `Proc_GetCCInformationusingStudyId`(PstudyId int,CCDetails varchar(50))
BEGIN

 select group_concat(tu.emailID separator ',') from trans_users tu where id in (SELECT Max(us.UserId) FROM trans_user_studies us 
 inner join trans_projects p on p.Id=us.ProjectId 
 inner join trans_users u on u.Id =us.UserId
 inner join trans_roles r on r.Id =us.RoleId Where us.ProjectId=PstudyId and r.NotificationStatus=0 and FIND_IN_SET(us.RoleId,CCDetails) group by us.UserId);
 
END ;;
