CREATE DEFINER=`root`@`localhost` PROCEDURE `Proc_GetCCInformationusingUserId`(PUserId int,CCDetails varchar(50))
BEGIN

Declare PorjectInfo varchar(100);
set @projectinfo=(select group_concat(ProjectId SEPARATOR ',') from trans_user_studies where UserId=PUserId and IsActive=1);


select group_concat(tu.emailID separator ',') from trans_users tu where id in (SELECT  Max(us.UserId) FROM trans_user_studies us inner join trans_projects p on p.Id=us.ProjectId inner join trans_users u on u.Id =us.UserId inner join trans_roles r on r.Id =us.RoleId Where FIND_IN_SET(us.projectId,@projectinfo)
 and r.NotificationStatus=0 and us.isactive=1 and u.isactive=1 and FIND_IN_SET(us.RoleId,CCDetails) group by us.UserId); 
END ;;
