   inner join lkp_country co on co.Id=s.CountryId
   where c.CompanyId=pCompanyId and s.StateId=pStateId and c.IsActive=1;
  else
   select c.*,s.*,co.* from lkp_city c inner join
   lkp_state s on s.Id=c.StateId 
   inner join lkp_country co on co.Id=s.CountryId
   where c.CompanyId=pCompanyId and IsActive=1;
   end if;
 end ;;
