CREATE DEFINER=`root`@`localhost` PROCEDURE `proc_getdrugexpirereport`(in pStudyId int)
BEGIN
if(pStudyId>0)
then
select invi.StudyId as studyId,invi.SiteId as siteId,invi.StockId as stockId,
inve.Product as Product,inve.ExpireDate as ExpireDate,
inve.ManufactureDate as ManufactureDate,
s.SiteName as SiteName
from trans_inventoryissue invi
inner join trans_sites s on s.Id=invi.SiteId 
inner join trans_inventorystock inve on inve.Id=invi.StockId
where invi.StudyId=pStudyId 
group by invi.StudyId,invi.SiteId,invi.StockId;
else
select invi.StudyId as studyId,invi.SiteId as siteId,invi.StockId as stockId,
inve.Product as Product,inve.ExpireDate as ExpireDate,
inve.ManufactureDate as ManufactureDate,
s.SiteName as SiteName,
p.StudyName as StudyName
from trans_inventoryissue invi
inner join trans_sites s on s.Id=invi.SiteId 
inner join trans_inventorystock inve on inve.Id=invi.StockId
inner join trans_projects p on p.Id=invi.StudyId
group by invi.StudyId,invi.SiteId,invi.StockId;
end if;
end ;;
