CREATE DEFINER=`root`@`localhost` PROCEDURE `proc_GetparentRoleDetails`(pRoleId int, pCompanyId varchar(200))
Begin
# take parent role when role Id 1,3,5
declare ParentroleInfo int;
set ParentroleInfo=(select ifnull(ParentRoleId,0)  from trans_roles where CompanyId=pCompanyId and Id=pRoleId);
if(ParentroleInfo in(1,3,5))then
select * from trans_roles where CompanyId=pCompanyId and Id=ParentroleInfo;
else
select * from trans_roles where CompanyId=pCompanyId and Id=0;
end if;
end ;;
