CREATE DEFINER=`root`@`localhost` PROCEDURE `proc_GetRecruitmentDetails`(in pStudyId int)
begin
if(pStudyId>0)
then
select r.Targeted,sum(r.Actual) as Actual,sum(r.InformedConsent) as InformedConsent
,sum(r.Screened) as Screened , sum(r.Randomization) as Randomization ,
sum(r.ScreenFailure) as ScreenFailure,sum(r.excluded) as excluded,sum(r.Dropped) as Dropped,
r.SiteId,s.SiteName,'' StudyName,pStudyId as StudyId
from trans_recruitment r  
inner join trans_sites s on s.Id=r.SiteId 
where r.StudyId=pStudyId 
group by r.SiteId;
else
select r.Targeted,sum(r.Actual) as Actual,sum(r.InformedConsent) as InformedConsent
,sum(r.Screened) as Screened , sum(r.Randomization) as Randomization ,
sum(r.ScreenFailure) as ScreenFailure,sum(r.excluded) as excluded,sum(r.Dropped) as Dropped,r.SiteId,s.SiteName
,p.StudyName as StudyName,r.StudyId as StudyId
from trans_recruitment r  
inner join trans_projects p on p.Id=r.StudyId
inner join trans_sites s on s.Id=r.SiteId 
group by r.StudyId;
end if;
end ;;
