if (pStudyId>0) then
select sv.*,vt.*,u.*,si.*,tp.* FROM trans_sitexvisits sv 
inner join lkp_visittypes vt on vt.Id=sv.VisitTypeId
inner join trans_users u on u.Id=sv.CraId
inner join trans_sites si on si.Id=sv.SiteId
inner join trans_projects tp on tp.ID=sv.StudyId
where sv.StudyId=pStudyId and ToDate>NOW() ;
else
select sv.*,vt.*,u.*,si.*,tp.* FROM trans_sitexvisits sv 
inner join lkp_visittypes vt on vt.Id=sv.VisitTypeId
inner join trans_users u on u.Id=sv.CraId
inner join trans_sites si on si.Id=sv.SiteId
inner join trans_projects tp on tp.ID=sv.StudyId
where ToDate>NOW() ;
end if;
end ;;
