CREATE DEFINER=`root`@`localhost` PROCEDURE `Proc_GetSiteVisitsByMonth`(
IN pMonth int,
IN pYear int,
IN pSiteId int,
In pStudyId int
)
BEGIN
if(pSiteId=0)then
SELECT sv.*,vt.*,u.* FROM trans_sitexvisits sv 
inner join lkp_visittypes vt on vt.Id=sv.VisitTypeId
inner join trans_users u on u.Id=sv.CraId
where sv.StudyId=pStudyId
and ((MONTH(FromDate)=pMonth and YEAR(FromDate)=pYear)
or (MONTH(ToDate)=pMonth and YEAR(ToDate)=pYear))
order by sv.Id desc;
else
SELECT sv.*,vt.*,u.* FROM trans_sitexvisits sv 
inner join lkp_visittypes vt on vt.Id=sv.VisitTypeId
inner join trans_users u on u.Id=sv.CraId
where sv.SiteId=pSiteId and
sv.StudyId=pStudyId
and ((MONTH(FromDate)=pMonth and YEAR(FromDate)=pYear)
or (MONTH(ToDate)=pMonth and YEAR(ToDate)=pYear))
order by sv.Id desc;
end If;
END ;;
