CREATE DEFINER=`root`@`localhost` PROCEDURE `Proc_Inventory_Issue`(
In StudyIdP int,
In SiteIdP int,
In StockIdP int,
In StockIssueCountP int,
In IssuedDateP Date,
In CreatedByIdP int,
In CreatedIpP varchar(45)
)
BEGIN
	
	declare stockcountP int;
    declare stockissuedP int;
    declare balanceP int;
    
    insert into trans_inventoryissue
    (StudyId,SiteId,StockId,StockIssueCount,IssuedDate,CreatedById,CreatedIp)
    values
    (StudyIdP,SiteIdP,StockIdP,StockIssueCountP,IssuedDateP,CreatedByIdP,CreatedIpP);
    
   
    
    select StockReceived,StockIssued into stockcountP,stockissuedP
    from trans_inventorystock where Id=StockIdP;
    
    SET stockissuedP=stockissuedP+StockIssueCountP;
    set balanceP=stockcountP-stockissuedP;
    
    select stockissuedP;
    select StockIssueCountP;
    select balanceP;
    
    update trans_inventorystock
    set StockIssued=stockissuedP,
    Balance=balanceP,
    ModifiedById=CreatedByIdP,
    ModifiedIp=CreatedIpP,
    ModifiedDate=now()
    where Id=StockIdP;
    
    
END ;;
DELIMITER ;
