Begin
declare IsAchivedCount int;
declare IsMileStoneEditable bool;
set IsMileStoneEditable=false;
set IsAchivedCount=(select count(*) from trans_studyxmilestones where StudyId=pStudyId and IsMileStoneAchieved=1);
