CREATE DEFINER=`root`@`localhost` PROCEDURE `Proc_MileStonesReport`(IN pStudyId int)
BEGIN

if(pStudyId>0)
then
select ms.*, mt.*, c.*,p.* from trans_studyxmilestones ms 
inner join trans_projects p on p.Id=ms.StudyId
inner join lkp_milestonetypes mt on mt.Id = ms.TypeId
inner join lkp_currency c on c.Id=ms.CurrencyId
where ms.StudyId=pStudyId
order by ms.Id desc;
else
select ms.*, mt.*, c.*,p.* from trans_studyxmilestones ms 
inner join trans_projects p on p.Id=ms.StudyId
inner join lkp_milestonetypes mt on mt.Id = ms.TypeId
inner join lkp_currency c on c.Id=ms.CurrencyId
order by ms.Id desc;
end if;
END ;;
