CREATE DEFINER=`root`@`localhost` PROCEDURE `Proc_MileStones_RaiseInvoice`(
IN pId int,
In pIsMileStoneAchieved bit,
IN pIsInvoiceRaised bit,
IN pRaisedOn datetime, 
IN pModifiedDate datetime,
In pModifiedById int,
In pModifiedIP varchar(100),
In pInvoiceRaisedAmount decimal,
in pInvoiceNumber varchar(50),
in pAmountDescription varchar(1000),
in pTaxPercentage double
)
BEGIN

SELECT @creditPeriod := CreditPeriod FROM trans_studyxmilestones 
WHERE trans_studyxmilestones.Id = pId;

update trans_studyxmilestones set
IsInvoiceRaised = pIsInvoiceRaised, RaisedOn = pRaisedOn,
InvoiceRaisedAmount=pInvoiceRaisedAmount,
PaymentDueDate = NOW() + INTERVAL @creditPeriod DAY,
 ModifiedDate = pModifiedDate, ModifiedById = pModifiedById,
ModifiedIP = pModifiedIP,InvoiceNumber=pInvoiceNumber,AmountDescription=pAmountDescription,TaxPercentage=pTaxPercentage
where Id =pId;


END ;;
