CREATE DEFINER=`root`@`localhost` PROCEDURE `Proc_Monitoring_GetAllStudies`(
in pId int
)
BEGIN

	if pId = 0 then

	Select p.*, us.UserId, r.Name as RoleName, us.RoleId from trans_projects p inner join 
    trans_user_studies us on p.Id = us.ProjectId inner join
    trans_roles r on r.Id = us.RoleId and r.CompanyId = p.CompanyId
    where us.IsActive = 1;
    end if;
     if pId !=0 then
     Select p.*, us.UserId, r.Name as RoleName, us.RoleId from trans_projects p inner join 
    trans_user_studies us on p.Id = us.ProjectId 
    inner join
    trans_roles r on r.Id = us.RoleId and r.CompanyId = p.CompanyId
    where us.IsActive = 1
    and us.UserId = pId;
    end if; 
    
    
END ;;
