CREATE DEFINER=`root`@`localhost` PROCEDURE `Proc_Monitoring_SiteVisits`(
in pStudyId int,
in pCraId int
)
BEGIN
if(pStudyId>0 and pCraId>0)then
SELECT sv.*,vt.*,u.*, s.* FROM trans_sitexvisits sv 
   inner join trans_sites s on s.Id = sv.SiteId
inner join lkp_visittypes vt on vt.Id=sv.VisitTypeId
inner join trans_users u on u.Id=sv.CraId 
where sv.StudyId = pStudyId and  sv.CraId=pCraId;
else if(pStudyId>0)then
SELECT sv.*,vt.*,u.*, s.* FROM trans_sitexvisits sv 
   inner join trans_sites s on s.Id = sv.SiteId
inner join lkp_visittypes vt on vt.Id=sv.VisitTypeId
inner join trans_users u on u.Id=sv.CraId 
where sv.StudyId = pStudyId;
else if(pCraId>0) then
SELECT sv.*,vt.*,u.*, s.* FROM trans_sitexvisits sv 
   inner join trans_sites s on s.Id = sv.SiteId
inner join lkp_visittypes vt on vt.Id=sv.VisitTypeId
inner join trans_users u on u.Id=sv.CraId 
where  sv.CraId=pCraId;
else
SELECT sv.*,vt.*,u.*, s.* FROM trans_sitexvisits sv 
   inner join trans_sites s on s.Id = sv.SiteId
inner join lkp_visittypes vt on vt.Id=sv.VisitTypeId
inner join trans_users u on u.Id=sv.CraId 
where sv.StudyId = pStudyId and  sv.CraId=pCraId;
end if; 
end if;
end if;
END ;;
