CREATE DEFINER=`root`@`localhost` PROCEDURE `Proc_Monitor_GetSAETerm`(
in pVisitId int
)
BEGIN

  
  if pVisitId=0 then
    Select se.*,p.*,s.* from trans_saeterm as se 
    inner join trans_projects as p on p.Id=se.StudyId
    inner join trans_sites as s on s.Id=se.SiteId
    where se.IsActive=1;
 end if;
 
  if pVisitId!=0 then
    Select se.*,p.*,s.* from trans_saeterm as se 
    inner join trans_projects as p on p.Id=se.StudyId
    inner join trans_sites as s on s.Id=se.SiteId
    where se.VisitId = pVisitId and se.IsActive=1;
 end if;
END ;;
