CREATE DEFINER=`root`@`localhost` PROCEDURE `Proc_Monitor_RecruitmentStatus`(
in pStudyId int,
in pVisitId int,
in pRecruitmentStatusIssues VARCHAR(1000),
in pIsStatusIssuesAvailable tinyint,
in pRecruitmentStatusComments VARCHAR(1000),
in pSubjectsEnrolledForTrail  VARCHAR(1000),
in pISSubjectsEligableForTrail   tinyint,
in pSubjectsEligableComments   varchar(1000),
in pAssignAllocation VARCHAR(1000), 
in pISAssigAllocation tinyint,
in pAssignAllocationComments VARCHAR(1000),
in pScreenedSubject VARCHAR(1000),
in pIsScreenedSubjectDuplicationVerified tinyint,
in pSubjectEnrollmentLog  VARCHAR(1000),
in pISSubjectEnrollmentLog tinyint,
in pSubjectEnrollmentLogComments VARCHAR(1000),
in pCreatedById int ,
in pCreatedIP  varchar(500),
in pCreateDate Datetime
)
BEGIN

insert into trans_RecruitmentStatus(StudyId, VisitId, 
RecruitmentStatusIssues,IsStatusIssuesAvailable,RecruitmentStatusComments,SubjectsEnrolledForTrail,ISSubjectsEligableForTrail,
SubjectsEligableComments,AssignAllocation,ISAssigAllocation,AssignAllocationComments,screenedsubject,IsScreenedSubjectDuplicationVerified,
SubjectEnrollmentLog,ISsubjectEnrollmentLog,SubjectEnrollmentLogComments,CreatedById,CreatedIP,CreateDate
)
values(pStudyId,pVisitId,pRecruitmentStatusIssues,pIsStatusIssuesAvailable,pRecruitmentStatusComments,pSubjectsEnrolledForTrail,
pISSubjectsEligableForTrail,pSubjectsEligableComments,pAssignAllocation,pISAssigAllocation,pAssignAllocationComments,
pScreenedSubject,pIsScreenedSubjectDuplicationVerified,pSubjectEnrollmentLog,pISSubjectEnrollmentLog,pSubjectEnrollmentLogComments,pCreatedById,pCreatedIP,pCreateDate);
call proc_Monitoring_UpdateReportStatusToInprogress(pVisitId);
END ;;
