CREATE DEFINER=`root`@`localhost` PROCEDURE `Proc_ProjectManagement_GetAllProjects`(
in pCompanyId varchar(200)
)
BEGIN

select p.*,u.*,c.*,st.* from trans_projects p inner join trans_users u on u.Id=p.ProjectManagerId
left join lkp_country c on c.Id=p.CountryId
left join lkp_state st on st.Id=p.StateId
where p.IsDeleted=0 and p.CompanyId =pCompanyId;
END ;;
