CREATE DEFINER=`root`@`localhost` PROCEDURE `Proc_ProjectManagement_GetAllProjectsOfPM`(
IN pmId INT
)
BEGIN
 if pmId = 0 then
	select p.*, us.RoleId, r.Name as RoleName,u.Id,u.Name,u.UserName from trans_projects p
	inner join trans_user_studies us on
	p.Id = us.ProjectId inner join
	trans_users u on u.Id = p.ProjectManagerId inner join
    trans_roles r on r.Id = us.RoleId and r.CompanyId = u.CompanyId
  where us.IsActive = 1;
  end if;
  if pmId != 0 then
  select p.*, us.RoleId, r.Name as RoleName,u.Id,u.Name,u.UserName from trans_projects p
	inner join trans_user_studies us on
	p.Id = us.ProjectId inner join
	trans_users u on u.Id = p.ProjectManagerId inner join
    trans_roles r on r.Id = us.RoleId and r.CompanyId = u.CompanyId
   where us.UserId = pmId and us.IsActive = 1;
  end if;


END ;;
DELIMITER ;
