CREATE DEFINER=`root`@`localhost` PROCEDURE `Proc_ProjectsSiteCount`()
Begin
select  tp.*,ifnull(count(e.StudyId),0) as SiteCount from trans_projects tp Left join (select * from trans_studyxsites where IsActive=1) as e  on tp.Id=e.StudyId where tp.IsDeleted=0
group by e.StudyId ;
End ;;
