Left join (select * from trans_studyxsites where IsActive=1) as e  
on tp.Id=e.StudyId inner join trans_user_studies us on tp.Id = us.ProjectId and us.IsActive = 1
where tp.IsDeleted=0 and us.UserId = pmId
group by e.StudyId ;
END ;;
