CREATE DEFINER=`root`@`localhost` PROCEDURE `proc_ProtocolDeviationCount`(pCompanyId varchar(200))
begin
select  count(*) as ProtocolDeviationCount,ss.StudyId,p.StudyName
from trans_studyxsites as ss 
inner join trans_projects as p on  ss.StudyId=p.Id
inner join trans_sites as s on s.Id=ss.SiteId
inner join trans_user_studies us on us.ProjectId = p.Id
where ss.IsActive=1 and p.CompanyId=pCompanyId group by ss.StudyId ;
end ;;
