CREATE DEFINER=`root`@`localhost` PROCEDURE `Proc_PSSV_ActionItems`(
	pAction VARCHAR(10)
	,pid int
	,pstudyId int
    ,pvisitId int
    ,pIssueDescription varchar(10000)
    ,pActionRole int
	,pActionName varchar(45)
	,pActionDate datetime
	,pActionBy varchar(45)
	,pStatus varchar(45)
	,pExpctedDateOfResolution datetime
	,pDateOfResolution datetime
	,pComments varchar(5000)
	,pCreatedBy int
	,pCreatedIp varchar(45)
	,pCreatedDate datetime
	,pModifiedBy int
	,pModifiedIp varchar(45)
	,pModifiedDate datetime
)
BEGIN
	-- SELECT ALL
     IF pAction = "SELECTALL" THEN
         SELECT * FROM trans_pssv_actionitems WHERE IsDelete = 0 and ActionRole = pActionRole AND studyId = pstudyId AND visitId = pvisitId;
      END IF;
   -- SELECT
     IF pAction = "SELECT" THEN
         SELECT * FROM trans_pssv_actionitems WHERE id = pId and ActionRole = pActionRole;
      END IF;
      
     -- INSERT
     IF pAction = "INSERT" THEN
         INSERT INTO trans_pssv_actionitems
			(studyId,visitId,IssueDescription,ActionRole,Action,ActionDate,ActionBy,Status,ExpctedDateOfResolution,DateOfResolution,Comments,IsDelete,CreatedBy,CreatedIp,CreatedDate)
		VALUES
			(pstudyId,pvisitId,pIssueDescription,pActionRole,pActionName,pActionDate,pActionBy,pStatus,pExpctedDateOfResolution,pDateOfResolution,pComments,0,pCreatedBy,pCreatedIp,pCreatedDate);
     END IF; 
     
     -- UPDATE
     IF pAction = "UPDATE" THEN
		UPDATE trans_pssv_actionitems
		SET
			studyId = pstudyId,
			visitId = pvisitId,
			IssueDescription = pIssueDescription,
			Action = pActionName,
			ActionDate = pActionDate,
			ActionBy = pActionBy,
			Status = pStatus,
			ExpctedDateOfResolution = pExpctedDateOfResolution,
			DateOfResolution = pDateOfResolution,
			Comments = pComments,
			ModifiedBy = pModifiedBy,
			ModifiedIp = pModifiedIp,
			ModifiedDate = pModifiedDate
		WHERE id = pid and ActionRole = pActionRole;

     END IF;
     
     -- DELETE
     IF pAction = "DELETE" THEN
         UPDATE trans_pssv_actionitems SET IsDelete = 1  WHERE id = pid and ActionRole = pActionRole;
     END IF;
END ;;
