CREATE DEFINER=`root`@`localhost` PROCEDURE `proc_RecurtmentStattus1`(in PStudyId int)
begin
 declare WeekCount int;
 declare WeekBdate date;
 declare k_Id int DEFAULT 0;
  declare k_Id1 int DEFAULT 0;
 declare LstartDate datetime;
 declare LendDate datetime;
 declare K_Targeted int DEFAULT 0;
 declare k_Actual int DEFAULT 0;
 declare WeekEdate date;
 declare WeeekBName varchar(45);
 declare WeekNo int;
  set WeekNo = 0;
 set WeekCount=ceil((select datediff(curdate(),date(CreatedDate))/7 from trans_projects where Id=PStudyId));
 set WeekBdate=(select date(CreatedDate) from  trans_projects where Id=PStudyId);
  DROP TEMPORARY TABLE  If EXISTS WeekTable1;
  CREATE TEMPORARY  TABLE WeekTable1 (
  `Id` INT NOT NULL AUTO_INCREMENT,
  `StudyName` varchar(5000) null,
  `WeekName` VARCHAR(45) NULL,
  `Actual` int null,
  `Targeted` int null,
  `StartDate` DATETIME NULL,
  `EndDate` DATETIME NULL,
  PRIMARY KEY (`Id`))
ENGINE = InnoDB
DEFAULT CHARACTER SET = utf8;
  while (WeekCount>0) Do
        set WeekNo=WeekNo+1;
		set WeeekBName=concat('Week', WeekNo);
        set WeekEdate=DATE_ADD(WeekBdate ,INTERVAL 7 day);
        
        
       insert into WeekTable1(WeekName,StudyName,Actual,Targeted,StartDate,EndDate)values(WeeekBName,(select StudyName from trans_projects where Id=PStudyId),k_Actual,K_Targeted,WeekBdate,WeekEdate);
          
        set WeekBdate=WeekEdate;
        set WeekCount=WeekCount-1;
   END while;
Block1: BEGIN
DECLARE done INT DEFAULT 0;
declare k_Id1 int DEFAULT 0;
declare k_Id int DEFAULT 0;
DECLARE Weekdata_cursor CURSOR FOR SELECT Id from  WeekTable1; 
DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = 1;

OPEN Weekdata_cursor;
REPEAT
FETCH Weekdata_cursor INTO k_Id1;

if done!=1 then
Block2: BEGIN
DECLARE done2 INT DEFAULT 0;
DECLARE Recurtment_cursor CURSOR FOR SELECT Id from  trans_recruitment where StudyId=PStudyId;
DECLARE CONTINUE HANDLER FOR NOT FOUND SET done2 = 1;
OPEN Recurtment_cursor;
REPEAT
FETCH Recurtment_cursor INTO k_Id;
		if done2!=1 then 
             
             set LstartDate=(select date(StartDate) from WeekTable1 where Id=k_Id1);
             set LendDate=(select date(EndDate) from WeekTable1 where Id=k_Id1);
 if((select date(EnrollmentDate) from trans_recruitment where Id=K_Id) is null) then
			   
                set k_Actual=k_Actual+ifnull((select Actual from trans_recruitment where Id=K_Id  and (date(LstartDate)<=date(FromEnrollment) and date(FromEnrollment)<date(LendDate)) and(date(LstartDate)<=date(ToEnrollment) and date(ToEnrollment)<date(LendDate))),0);	
               set  k_Targeted= K_Targeted+ifnull((select Targeted from trans_recruitment where Id=K_Id  and (date(LstartDate)<=date(FromEnrollment) and date(FromEnrollment)<date(LendDate)) and(date(LstartDate)<=date(ToEnrollment) and date(ToEnrollment)<date(LendDate))),0);
			 
             else 
               
               set k_Actual=k_Actual+ifnull((select Actual from trans_recruitment where Id=K_Id  and (date(LstartDate)<=date(EnrollmentDate) and date(EnrollmentDate)<date(LendDate))),0);
               set K_Targeted=K_Targeted+ifnull((select Targeted from trans_recruitment where Id=K_Id  and (date(LstartDate)<=date(EnrollmentDate) and date(EnrollmentDate)<date(LendDate))),0);
			   
            end if;
        end  if; 
UNTIL done2 END REPEAT;
CLOSE Recurtment_cursor;
END Block2;
  
 update WeekTable1 set Actual=k_Actual ,Targeted=K_Targeted where Id=k_Id1;
  set k_Actual=0;
 set K_Targeted=0;
 end if;
UNTIL done END REPEAT;
CLOSE Weekdata_cursor;
END Block1;
select * from WeekTable1;
end ;;
DELIMITER ;
