CREATE DEFINER=`root`@`localhost` PROCEDURE `proc_RecurtmentStattus11`(PStudyId int)
begin
 declare WeekCount int;
 declare WeekBdate date;
 declare k_Id int DEFAULT 0;
  declare k_Id1 int DEFAULT 0;
 DECLARE _continue INT DEFAULT 0;
 DECLARE _continue1 INT DEFAULT 0;
 declare K_Targeted int DEFAULT 0;
 declare k_Actual int DEFAULT 0;
 declare WeekEdate date;
 declare WeeekBName varchar(45);
 declare WeekNo int;
  DEClARE Weekdata_cursor CURSOR  FOR 
 SELECT Id from  WeekTable1; 
 DECLARE continue HANDLER FOR NOT FOUND
  SET _continue =1;
 set WeekNo = 0;
 set WeekCount=ceil((select datediff(curdate(),date(CreatedDate))/7 from trans_projects where Id=PStudyId));
 set WeekBdate=(select date(CreatedDate) from  trans_projects where Id=PStudyId);
  DROP TEMPORARY TABLE  If EXISTS WeekTable1;
  CREATE TEMPORARY  TABLE WeekTable1 (
  `Id` INT NOT NULL AUTO_INCREMENT,
  `StudyName` varchar(5000) null,
  `WeekName` VARCHAR(45) NULL,
  `Actual` int null,
  `Targeted` int null,
  `StatDate` DATETIME NULL,
  `EndDate` DATETIME NULL,
  PRIMARY KEY (`Id`))
ENGINE = InnoDB
DEFAULT CHARACTER SET = utf8;
  while (WeekCount>0) Do
        set WeekNo=WeekNo+1;
		set WeeekBName=concat('Week', WeekNo);
        set WeekEdate=DATE_ADD(WeekBdate ,INTERVAL 7 day);
        
        
       insert into WeekTable1(WeekName,StudyName,Actual,Targeted,StatDate,EndDate)values(WeeekBName,(select StudyName from trans_projects where Id=PStudyId),k_Actual,K_Targeted,WeekBdate,WeekEdate);
          
        set WeekBdate=WeekEdate;
        set WeekCount=WeekCount-1;
   END while;
   select * from WeekTable1;
   open Weekdata_cursor ;
     Weekdata_loop :loop 
     fetch Weekdata_cursor into k_Id1 ;
      if _continue!=1 then 
         select k_Id1;
        BLOCK2: BEGIN
        DECLARE Recurtment_cursor CURSOR FOR SELECT Id from  trans_recruitment where StudyId=PStudyId;
        DECLARE CONTINUE HANDLER FOR NOT FOUND SET _continue1 = 1;
        OPEN Recurtment_cursor; 
        get_RecurtmentLoop: LOOP
        FETCH  Recurtment_cursor INTO k_Id;   
             if _continue!=1 then 
             select k_Id;
           if((select date(EnrollmentDate) from trans_recruitment where Id=K_Id) is null) then
			   
               set k_Actual=k_Actual+ifnull((select Actual from trans_recruitment where Id=K_Id  and (WeekBdate<=date(FromEnrollment) and date(FromEnrollment)<WeekEdate) and(WeekBdate<=date(ToEnrollment) and date(ToEnrollment)<WeekEdate)),0);	
               set  k_Targeted= K_Targeted+ifnull((select Targeted from trans_recruitment where Id=K_Id  and (WeekBdate<=date(FromEnrollment) and date(FromEnrollment)<WeekEdate) and(WeekBdate<=date(ToEnrollment) and date(ToEnrollment)<WeekEdate)),0);
			 
             else 
               
               set k_Actual=k_Actual+ifnull((select Actual from trans_recruitment where Id=K_Id  and (WeekBdate<=date(EnrollmentDate) and date(EnrollmentDate)<WeekEdate)),0);
               set K_Targeted=K_Targeted+ifnull((select Targeted from trans_recruitment where Id=K_Id  and (WeekBdate<=date(EnrollmentDate) and date(EnrollmentDate)<WeekEdate)),0);
			   
            end if;
             select k_Actual,k_Targeted;
             update WeekTable1 set Actual=k_Actual ,Targeted=K_Targeted where Id=k_Id1;
         else
          leave get_RecurtmentLoop;
         
         end  if;
         end  loop get_RecurtmentLoop;
        close Recurtment_cursor;
        END BLOCK2;
       
         
          set k_Actual=0;
          set K_Targeted=0;
          
        else
        leave Weekdata_loop;
        end if;
        end loop Weekdata_loop;
        close Weekdata_cursor ;
   #select k_Id1;
  select * from WeekTable1;
  
end ;;
