begin
select p.Id,p.StudyName,SUM(if(pd.IsActive =1, 1, 0)) as PdCount from trans_projects p  
left join trans_protocoldeviationlog pd  on pd.StudyId=p.Id where p.CompanyId=pCompanyId  group by p.Id;
