CREATE DEFINER=`root`@`localhost` PROCEDURE `Proc_SCV_StudyStatus`(
	pAction VARCHAR(10)
	,pId INT
    ,pstudyId int
    ,pvisitId int
	,pdate datetime
	,pparticipantstatus varchar(5000)
	,pnoofparticipants VARCHAR(1000)
    ,pcomments VARCHAR(1000)
	,pCreatedBy int
	,pCreatedIp varchar(45)
	,pCreatedDate datetime
	,pModifiedBy int
	,pModifiedIp varchar(45)
	,pModifiedDate datetime
)
BEGIN
	-- SELECT
    IF pAction = "SELECTALL" THEN
        SELECT * FROM trans_scv_studystatus WHERE IsDelete = 0 AND studyId = pstudyId AND visitId = pvisitId;
     END IF;
  -- SELECT
    IF pAction = "SELECT" THEN
        SELECT * FROM trans_scv_studystatus WHERE Id = pId;
     END IF;
     
    -- INSERT
    IF pAction = "INSERT" THEN
        INSERT INTO trans_scv_studystatus
			(studyId,visitId,date,participantstatus,noofparticipants,comments,IsDelete,CreatedBy,CreatedDate,CreatedIp)
		VALUES
			(pstudyId,pvisitId,pdate,pparticipantstatus,pnoofparticipants,pcomments,0,pCreatedBy,pCreatedDate,pCreatedIp);
    END IF; 
    
    -- UPDATE
    IF pAction = "UPDATE" THEN
        UPDATE trans_scv_studystatus
		SET
        studyId = pstudyId,
        visitId = pvisitId,
		date = pdate,
		participantstatus = pparticipantstatus,
		noofparticipants = pnoofparticipants,
        comments = pcomments,
		ModifiedBy = pModifiedBy,
		ModifiedDate = pModifiedDate,
		ModifiedIp = pModifiedIp
		WHERE id = pId;
    END IF;
    
    -- DELETE
    IF pAction = "DELETE" THEN
        UPDATE trans_scv_studystatus SET IsDelete = 1  WHERE id = pId;
    END IF;
END ;;
DELIMITER ;
