CREATE DEFINER=`root`@`localhost` PROCEDURE `Proc_Sites_GetSitesRelatedToStudy`(
IN pStudyId INT
)
BEGIN
SELECT  t.Id,
    t.SiteName,
    t.SiteId,
    t.CountryId,
    t.CityName,
    t.Location,
    t.ContactNo,
    t.CreatedDate,
    t.ModifiedDate,
    t.CreatedBy,
    t.ModifiedBy,
    t.CreatedIP,
    t.ModifiedIP,
    t.IsDeleted,ss.*,c.*
FROM trans_sites t 
inner join trans_studyxsites ss on ss.SiteId=t.Id
inner join lkp_country c on c.Id=t.CountryId
where ss.StudyId =pStudyId and ss.IsActive=1
order by t.Id desc;
END ;;
