CREATE DEFINER=`root`@`localhost` PROCEDURE `Proc_UpdateVisitStatusForBeyondEndDate`()
BEGIN

SET SQL_SAFE_UPDATES=0;
update trans_sitexvisits
set VisitStatus='Completed'
where VisitStatus='Not Yet Started'
and ToDate<now();

update trans_sitexvisits set VisitStatus='Missed'
where VisitReportStatus='Pending' and ReportsDueOn<now();

SET SQL_SAFE_UPDATES=1;
END ;;
